const bindDrag = function (reactObj){
    let $head = $("#" + id + " .ant-table-header"),$wraper = $("#" + id + " .ant-table"),
    isDraging = false,$currTd,dragX;
    //清除之前绑定的事件
  	$head.off(".drag");
  	$wraper.off(".drag");
  	//绑定事件
  	$head.on("mousedown.drag",".resize-handler",function(e){
  			startDrag(e);
  			e.stopPropagation();
  	})
  	$wraper.on({
  			"mousemove.drag":function(e){
  					draging(e);
  			},
  			"mouseleave.drag":function(e){
  					endDrag(e);
  			},
  			"mouseup.drag":function(e){
  					endDrag(e);
  			}
  	})

  	//开始拖拽
  	var startDrag = function(e){
  			if(isDraging) return;
  			isDraging = true;
  			$currTd = $(e.target).parents("th");//当前td
  			dragX = e.clientX || e.pageX;
  			document.body.onselectstart = function(){return false};//禁止浏览器默认选中行为
  			e.stopPropagation();
  	}
  	//结束
  	var endDrag = function(e){
  			if(!isDraging) return;
  			isDraging = false;
  			document.body.onselectstart = function(){return true};//解除浏览器默认选中行为
  			e.stopPropagation();
  	};
  	//拖拽中
  	var $gridData = $wraper//.find(".grid-body .grid-data");  //右半边表格，需要在draging中判断其宽度
  	var draging = function(e){
  			if(!isDraging) return;
  			var X = e.clientX || e.pageX;
  			var w = X-dragX;
  		  if($gridData.outerWidth() < 120 && w > 0) return ;
  			resizeCol($currTd,w);
  			dragX = X;
  			//_refreshScroll();
  			//_aynScrollLeft();//同步上下容器滚动偏移
  			e.stopPropagation();
  			e.preventDefault();
  	};

  	var resizeCol = function($td,w){
      console.log(w)
      var headName = $td.text(),idx;
      columns.map(function(column,i,cols){
        if(column.title == headName){
          idx = i
        }
      })

      if(w < 0 && columns[idx].width < $td.width() + 16){
        return;
        //columns[idx].width = $td.width() + 16;
      }
      if(!!!columns[idx].width){
        columns[idx].width = 149;
        if(!!$td.width()){
          columns[idx].width = $td.width() + 16;
        }
      }
      if(w != 0){
        columns[idx].width = columns[idx].width + w;
        // if(columns[idx].width < $td.width() + 16){
        //   //判断一次快速拖动时处理
        //   columns[idx].width = $td.width() + 16;
        // }
        // if((columns[idx].width - 17) < 0){
        //   return;
        // }
        reactObj.setState({scrollX: (reactObj.state.scrollX + w)});

    		reactObj.setState({columns: columns}, function(){
          // $("#" + id + " .ant-table-tbody tr").each(function(i,o){
          //   $(this).find("td").eq(idx).find("div").width(columns[idx].width - 17);
          // });
          var $tableDiv = $("#" + id);
          var $tableDivStyle = $("#" + id + " style");
          var style = "#" + id + " .ant-table-tbody td:nth-child(" + (idx+1) + ") div{width: " + (columns[idx].width - 17) + "px !important}";
          if(!!$tableDivStyle && $tableDivStyle.length > 0){
            $tableDivStyle.html(style);
          }else{
            $tableDiv.append("<style>" + style + "</style>");
          }
        });
      }
  	};
    return resizeCol;
}
let setDefaultWidth = function(){
  let text = "",width = 0;
  for(var i = 0;i < columns.length;i ++){
    if(!!!columns[i].width){
      text = columns[i].title;
      break;
    }
  }
  $("#" + id + " .ant-table-thead th").each((i,ele)=>{
    let thisText = $(ele).text()
    if(thisText == text){
      width = $(ele).width();
    }
  });
  for(var i = 0;i < columns.length;i ++){
    if(!!!columns[i].width){
      $("#" + id + " .ant-table-tbody tr").each(function(j,o){
        $(this).find("td").eq(i).find("div").width(width);
        //$(this).find("td").eq(i).width(width);
      })
    }
  }
}
